import React, {Component} from 'react';
import { Switch, Route, Redirect } from 'react-router-dom';
import Overview from '../components/Overview.js';
import HistoryNovas from '../components/HistoryNovas.js';
import Certificate from '../components/Certificate.js';
import Introduce from './Introduce.js';


export default () =>  {
        return(
            <Switch>
                {/* <Certificate /> */}
                {/* <Redirect to="/gioi-thieu/chung-chi-hop-tac" component={Certificate} /> */}
                <Route path="/gioi-thieu/chung-chi-hop-tac" component={Certificate} />
                <Route path="/gioi-thieu/tong-quan" component={Overview} />
                <Route path="/gioi-thieu/lich-su-novas" component={HistoryNovas} />
            </Switch>
        );
}
